import React, { Component } from 'react'
import { Row } from 'react-bootstrap';
import auth from '../auth/auth';

//Planten Pagina
export class UserDetails extends Component {

    render() {
        console.log(this.props.userData);
        if( !this.props.userData.logged_in ) {
            auth.redirect();
        }
        console.log( this.props.userData.logged_in );
        return (
            <div>
                <h2>Gegevens</h2>
                <Row>
                    <div className="col">E-mail adres:</div>
                    <div className="col">{this.props.userData.name}</div>            
                </Row>
                <Row>
                    <div className="col">Locatie:</div>
                    <div className="col">{this.props.userData.location}</div>            
                </Row>
                <Row>
                    <div className="col">Biography:</div>
                    <div className="col">{this.props.userData.bio}</div>            
                </Row>
            </div>
        )
    }
}

export default UserDetails
